script: |
  super -f text -I q7734.spq | sort > q7734.out

inputs:
  - name: q7734.spq
    data: |
      SELECT DISTINCT - col2 + - col0 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT - CAST ( NULL AS INTEGER ) NOT BETWEEN NULL AND col1 - - col2 * col2;
  - name: tab2

outputs:
  - name: q7734.out
    data: |
